llm_output:
function transfer(address recipient, uint256 amount) public override returns (bool) {
    address sender = _msgSender();

    // ----------------------------------------------------------------------
    // Basic ERC-20 sanity checks
    // ----------------------------------------------------------------------
    require(recipient != address(0),                         "ERC20: transfer to the zero address");
    require(amount     > 0,                                  "ERC20: transfer amount must be greater than zero");
    require(_balances[sender] >= amount,                     "ERC20: transfer amount exceeds balance");

    // ----------------------------------------------------------------------
    // Trading / limit-related checks
    // ----------------------------------------------------------------------
    bool isSell = automatedMarketMakerPairs[recipient];
    bool isBuy  = automatedMarketMakerPairs[sender];

    if (limitsInEffect) {
        // Trading must be enabled, unless either party is exempt from fees.
        if (!tradingEnabled) {
            require(
                _isExcludedFromFees[sender] || _isExcludedFromFees[recipient],
                "Trading is not active."
            );
        }

        // Max-tx checks (different revert strings for buys / sells)
        if (isSell && !_isExcludedFromMaxTxAmount[sender]) {
            require(amount <= maxTxAmount, "Sell transfer amount exceeds the maxTxAmount.");
        } else if (isBuy && !_isExcludedFromMaxTxAmount[recipient]) {
            require(amount <= maxTxAmount, "Buy transfer amount exceeds the maxTxAmount.");
        } else if (!_isExcludedFromMaxTxAmount[recipient]) {
            require(amount <= maxTxAmount, "Transfer amount exceeds the maxTxAmount.");
        }
    }

    // ----------------------------------------------------------------------
    // Automated swap-and-liquify if enabled
    // ----------------------------------------------------------------------
    uint256 contractTokenBalance = _balances[address(this)];
    bool canSwap = contractTokenBalance >= swapTokensAmount;

    if (
        canSwap &&
        swapEnabled &&
        !isBuy &&                       // do not trigger on buys
        sender != owner() &&            // owner is never taxed
        !_isExcludedFromFees[sender] &&
        !_isExcludedFromFees[recipient]
    ) {
        swapAndLiquify(contractTokenBalance);
    }

    // ----------------------------------------------------------------------
    // Fee processing
    // ----------------------------------------------------------------------
    bool takeFee = !_isExcludedFromFees[sender] && !_isExcludedFromFees[recipient];

    if (takeFee) {
        uint256 fees;

        if (isSell && sellTotalTaxes > 0) {
            fees = (amount * sellTotalTaxes) / 100;
            tokensForLP  += (fees * sellLPFee)  / sellTotalTaxes;
            tokensForDev += (fees * sellDevFee) / sellTotalTaxes;
            tokensForTeam+= (fees * sellTeamTax)/ sellTotalTaxes;
        } else if (isBuy && buyTotalTaxes > 0) {
            fees = (amount * buyTotalTaxes) / 100;
            tokensForLP  += (fees * buyLpFee)  / buyTotalTaxes;
            tokensForDev += (fees * buyDevFee) / buyTotalTaxes;
            tokensForTeam+= (fees * buyTeamTax)/ buyTotalTaxes;
        }

        if (fees > 0) {
            _balances[address(this)] += fees;
            emit Transfer(sender, address(this), fees);
        }

        amount -= fees; // amount is now the net amount to transfer
    }

    // ----------------------------------------------------------------------
    // Final balance updates
    // ----------------------------------------------------------------------
    _balances[sender]    -= amount;
    _balances[recipient] += amount;

    emit Transfer(sender, recipient, amount);
    return true;
}

